?><p style="text-align: justify;"><span style="font-size: medium;"><span style="font-family: &quot;Times New Roman&quot;;">История компании начинается с 1946 года, когда Жорж Дюбе, будучи учителем по часовому искусству в школе, вместе с коллегой Рене Шальденбрандом решили подать заявку на свое изобретение механизм, состоящий из одного маленького «перышка». Этот механизм был, по сути, упрощенной моделью сплит-хронографа. Впоследствии, именно этот механизм будет «визитной карточкой» компании Dubey Schaldenbrand. Можно сказать, что эта компания создала новые традиции в создании часов все прежние стереотипы о производстве постепенно стирались. На данный момент в концепции производства часов, компания делает ставку на тщательность обработки и воплощение традиций часоделия. Любой коллекционер или любитель часов будет поистине рад, пополнив свою коллекцию часами марки Dubey Schaldenbrander.</span></span></p>
 
